def get_total_number_of_sequences(m, n):
    # Initialize a 2D array to store the number of sequences
    dp = [[0 for _ in range(m + 1)] for _ in range(n + 1)]

    # There is one sequence of length 1: [1]
    for i in range(1, m + 1):
        dp[1][i] = 1

    # Calculate the number of sequences for each length
    for len_ in range(2, n + 1):
        for max_elem in range(2, m + 1):
            for prev_elem in range(2, max_elem // 2 + 1):
                # The current element can be any number from 2 * prev_elem to max_elem
                dp[len_][max_elem] += dp[len_ - 1][prev_elem]

    # Return the number of sequences for the given length and maximum element
    return dp[n][m]

