import math

def is_not_prime(n):
    if n <= 1:
        return False
    if n == 2:
        return False
    if n % 2 == 0:
        return True
    sqrt_n = math.isqrt(n)
    for i in range(3, sqrt_n + 1, 2):
        if n % i == 0:
            return True
    return False

def next_prime(n):
    if n <= 1:
        return 2
    if n >= 2:
        n += 1
    while is_not_prime(n):
        n += 1
    return n

def previous_prime(n):
    if n <= 2:
        return -1
    if n >= 3:
        n -= 1
    while is_not_prime(n):
        n -= 1
    return n

def nth_prime(n):
    if n <= 0:
        return -1
    primes = [2]
    num = 3
    while len(primes) < n:
        if is_not_prime(num):
            num += 2
        else:
            primes.append(num)
            num += 2
    return primes[-1]

