    for i in range(k):
        arr[i], arr[k - i - 1] = arr[k - i - 1], arr[i]

def pancake_sort(nums):
    n = len(nums)
    for i in range(n, 1, -2):
        if nums[i - 1] < nums[i - 2]:
            flip(nums, i - 1)
        if i > 2 and nums[i - 2] < nums[i - 3]:
            flip(nums, i - 2)
    return nums

